import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter } from 'react-router-dom';
import './index.css';
import App from './App';

ReactDOM.render(    
<BrowserRouter>
<body style="background-color: #fafafa;"></body>
    <App />
</BrowserRouter>,
 document.getElementById('app'));
